import React,{Component} from 'react'


class Search extends Component{

  constructor(props) {
    super(props);
    this.state = {
        value: '0'
    };
}
  render(){
    return(
      <div className="container">
        <p id="find-rest">Find the Best restaurants, cafes and bars</p>
          <div id="inputboxes">
            <select  value={this.state.value} id="inputbox1" className="inputbox"  placeholder="Please type a location">
            <option id="Placeholder1"value="0" disabled> Please type a location</option>
            </select>

            <select  id ="inputbox2"className="inputbox"  placeholder="Search for restaurants"></select>



          </div>

      </div>
    )
  }
}
export default Search
